// Funções do Database
function getAllProducts() {
    const allProducts = [];
    for (const category in productsDatabase) {
        allProducts.push(...productsDatabase[category]);
    }
    return allProducts;
}

function getProductsByCategory(category) {
    const categoryKey = category.toLowerCase();
    return productsDatabase[categoryKey] || [];
}

function getProductById(id) {
    const allProducts = getAllProducts();
    return allProducts.find(product => product.id === id);
}

function searchProducts(query) {
    const allProducts = getAllProducts();
    const searchTerm = query.toLowerCase();
    
    return allProducts.filter(product => 
        product.title.toLowerCase().includes(searchTerm) ||
        product.category.toLowerCase().includes(searchTerm) ||
        product.brand.toLowerCase().includes(searchTerm) ||
        product.description.toLowerCase().includes(searchTerm)
    );
}

function getProductsByPriceRange(minPrice, maxPrice) {
    const allProducts = getAllProducts();
    return allProducts.filter(product => 
        product.price >= minPrice && product.price <= maxPrice
    );
}

function getTopRatedProducts(limit = 10) {
    const allProducts = getAllProducts();
    return allProducts
        .sort((a, b) => b.rating - a.rating)
        .slice(0, limit);
}

function getProductsByBrand(brand) {
    const allProducts = getAllProducts();
    return allProducts.filter(product => 
        product.brand.toLowerCase() === brand.toLowerCase()
    );
}

function getFeaturedProducts(limit = 8) {
    const allProducts = getAllProducts();
    return allProducts
        .filter(product => product.rating >= 4.0)
        .sort((a, b) => b.rating - a.rating)
        .slice(0, limit);
}

// Exportar para Node.js
if (typeof module !== 'undefined' && module.exports) {
    module.exports = {
        productsDatabase,
        getAllProducts,
        getProductsByCategory,
        getProductById,
        searchProducts,
        getProductsByPriceRange,
        getTopRatedProducts,
        getProductsByBrand,
        getFeaturedProducts
    };
}